const ViewSellerPage = () => {
  const dispatch = useDispatch();
  const history = useHistory();
  const location = useLocation();
  const toast = useRef<Toast>(null);

  const { loadingGetById, viewData, loadingDelete } = useSelector((state: StoreState) => state.sellers);

  const { id } = useParams<{id: string}>();

  useEffect(() => {
    if ((!id || id === ':id')) {
      goToList();
    }
    if (id) {
      dispatch(getById(id));
    }
  }, [id]);

  const currentRoute = allRoutes.find((r) => r.id === 'view-seller');
  const editRoute = allRoutes.find((r) => r.id === 'edit-seller');
  const listRoute = allRoutes.find((r) => r.id === 'seller-list');

  const onEdit = () => {
    history.push(generatePath(editRoute?.path ?? '/', { id }));
  };

  const goToList = () => {
    history.push(listRoute?.path ?? '/');
  };

  const pageTitle = viewData?.name ? `Vendedor ${viewData?.name}` : currentRoute?.title ?? '';

  useEffect(() => {
    if (currentRoute) {
      dispatch(setCurrentPage({
        icon: currentRoute.icon,
        routeId: currentRoute.id,
        title: pageTitle,
        pageImage: currentRoute.pageImage,
      }));
      dispatch(pushBreadcrumb({
        path: location.pathname,
        routeId: currentRoute.id,
        title: pageTitle,
      }));
    }
  }, [currentRoute, viewData]);

  useEffect(() => {
    if ((!id || id === ':id')) {
      goToList();
    }
  }, [id]);

  const onDeleteSuccess = () => {
    toast.current?.show({
      severity: 'success', summary: 'Deletado!', detail: 'Registro removido com sucesso!', life: 1500,
    });
    setTimeout(goToList, 1500);
  };

  const confirmDelete = () => {
    confirmDialog({
      message: 'Deseja realmente deletar esse registro?',
      icon: 'pi pi-info-circle',
      acceptClassName: 'p-button-danger',
      // @ts-ignore
      header: 'Confirmar deleção',
      accept: () => dispatch(deleteRequest({ id, callBack: onDeleteSuccess })),
    });
  };

  return (
    <>
      <Toast ref={toast} />
      <Helmet>
        <title>{pageTitle}</title>
        <meta name="description" content="Visualizar um vendedor" />
      </Helmet>
      <Zoom in>
        <div id="view-seller-page" className="p-grid p-align-center">
          <Card className="p-col-12 p-xl-10" style={{ position: 'relative' }}>
            {(loadingGetById || loadingDelete) && (
              <>
                <Skeleton className="p-skeleton-loader" />
                <ProgressSpinner className="loader-app" />
              </>
            )}
            <div className="header-area">
              <img
                alt={viewData.name}
                src={viewData.avatarImage}
                onError={(e: any) => {
                  e.target.src = 'data:image/png;base64,';
                }}
                style={{ verticalAlign: 'middle', borderRadius: '12px' }}
                className="p-shadow-3 avatar-image"
              />
              <Button
                label="Deletar"
                className="p-button-danger"
                type="button"
                icon="pi pi-trash"
                onClick={confirmDelete}
              />
              <Button
                label="Editar"
                type="button"
                icon="pi pi-pencil"
                onClick={onEdit}
              />
            </div>
            <Divider />
            <TabView className="tabview-custom">
              <TabPanel header="Informações Gerais" leftIcon="pi pi-user">
                <div className="p-grid">
                  <div className="p-col p-grid">
                    <div className="p-col-4">
                      <div className="label">Nome:</div>
                      <div className="label-value">{viewData.name}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Empresa:</div>
                      <div className="label-value">{viewData.companyName}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">E-mail:</div>
                      <div className="label-value">{viewData.email}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Região:</div>
                      <div className="label-value">{viewData.zoneName}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Documento:</div>
                      <div className="label-value">{viewData.document}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Telefone:</div>
                      <div className="label-value">{viewData.phone}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Data de nascimento:</div>
                      <div className="label-value">{viewData.birthDate ? format(new Date(viewData.birthDate), 'dd/MM/yyyy') : ''}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Ativo:</div>
                      <div className="label-value">{viewData.enable ? 'Sim' : 'Não'}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Provas Enviadas:</div>
                      <div className="label-value">{viewData.totalProvesSent}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Treinamentos Concluídos:</div>
                      <div className="label-value">{viewData.totalTreinamentDones}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Último acesso:</div>
                      <div className="label-value">{viewData.lastAccess ? format(new Date(viewData.lastAccess), 'dd/MM/yyyy') : ''}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Data de Criação:</div>
                      <div className="label-value">{viewData.createdAt ? format(new Date(viewData.createdAt), 'dd/MM/yyyy') : ''}</div>
                    </div>
                    <div className="p-col-4">
                      <div className="label">Última Atualização:</div>
                      <div className="label-value">{viewData.updatedAt ? format(new Date(viewData.updatedAt), 'dd/MM/yyyy') : ''}</div>
                    </div>
                  </div>
                </div>
              </TabPanel>
              <TabPanel header="Provas Enviadas" leftIcon="pi pi-send">
                <SellerProvesSentView locations={mockLocations} />
              </TabPanel>
              <TabPanel header="Treinamentos Concluídos" leftIcon="pi pi-desktop">
                <SellerTreinamentView treinaments={mockTreinamentDones} />
              </TabPanel>
            </TabView>
          </Card>
        </div>
      </Zoom>
    </>
  );
};

export default ViewSellerPage;
